import React from "react";
import styled from "styled-components";

const SideBarContainer = styled.div`
    width: 80px;
    //max-width: 1920px;
    height: 100%;
    padding: 0 1vw;
    background: ${({ darkMode }) => (darkMode ? "#000" : "#F0F0F0")};
    display: flex;
    align-items: center;
    justify-content: space-between;
    position: fixed;
    top: 0;
    left: 0;
`

const SideBar = () => {
    return (
        <SideBarContainer>
        </SideBarContainer>
    );
}

export default SideBar;
